INSERT INTO `detail_asistensi` (`id`, `created_at`, `updated_at`, `isi`, `file`, `is_dosen`, `is_mahasiswa`, `id_asistensi`) VALUES
(1, '2020-06-29 07:30:18', '2020-06-29 07:30:18', '<p>BIMBINGAN SKRIPSI HASIL</p>', '20200629153018.pdf', NULL, '1', 1),
(2, '2020-07-02 03:22:20', '2020-07-02 03:22:20', '<p>Assalamualaikum wr wb. Pak saya mau asistensi mengenai permasalahan dan topik kelompok kerja praktik saya.&nbsp;</p>\r\n<p>Di tempat saya kerja praktik yaitu di PT Sinar Cahaya Langit memiliki 2 bidang. Bidang pertama mengenai penjualan property perumahan dan bidang yang kedua mengenai analisis data. Nah di kedua bidang tersebut memiliki permasalahan yaitu</p>\r\n<p>Bidang 1 : Untuk pendaftaran pembelian perumahan dan kelengkapan berkas masih manual</p>\r\n<p>Bidang 2 : Untuk pengelolaan analisis data masih manual juga</p>\r\n<p>&nbsp;</p>\r\n<p>Apakah kedua masalah tersebut salah satunya bisa di jadikan topik &amp; laporan kelompok saya ?</p>\r\n<p>Mohon saranya pak.</p>', NULL, NULL, '1', 2),
(3, '2020-07-02 08:22:14', '2020-07-02 08:22:14', '<p>Assalamualaikum wr wb. Pak saya mau asistensi mengenai permasalahan dan topik kelompok kerja praktik saya.&nbsp;</p>\r\n<p>Di tempat saya kerja praktik yaitu di PT Sinar Cahaya Langit memiliki 2 bidang. Bidang pertama mengenai penjualan property perumahan dan bidang yang kedua mengenai analisis data. Kedua bidang tersebut memiliki permasalahan yaitu</p>\r\n<p>Bidang 1 : Untuk pendaftaran pembelian perumahan dan kelengkapan berkas masih manual</p>\r\n<p>Bidang 2 : Untuk pengelolaan analisis data masih manual juga</p>\r\n<p>Apakah kedua masalah tersebut salah satunya bisa kami jadikan topik untuk laporan kelompok saya ?</p>\r\n<p>Mohon saranya pak🙏</p>', NULL, NULL, '1', 3),
(4, '2020-07-08 07:22:37', '2020-07-08 07:22:37', '<p>Berikut saya lampirkan file laporan bab 4 pak.</p>\r\n<p>saya juga sdh selesai bimbingan sama pak Dian, mengenai kuesionernya pak Dian sudah cek dan saya disuruh ke bpk untuk konfirmasi lagi kuesioner penelitian ini Pak....</p>\r\n<p>Terima kasih Pak.&nbsp;</p>', '20200708152237.pdf', NULL, '1', 4),
(5, '2020-07-09 08:18:00', '2020-07-09 08:18:00', '<p>Boleh, tapi kuatkan proses bisninya</p>', NULL, '1', NULL, 2),
(6, '2020-07-09 08:24:24', '2020-07-09 08:24:24', '<p>Tolong diisi progress bimbingan, karena saya tidak tahu history bimbingannya</p>', NULL, '1', NULL, 4),
(7, '2020-07-11 01:53:53', '2020-07-11 01:53:53', '<p>Baik pak terimakasih.&nbsp;</p>', NULL, NULL, '1', 2),
(8, '2020-07-11 02:55:12', '2020-07-11 02:55:12', '<p>Brikut saran\" dari dosen penguji pak :</p>\r\n<p>Dari pak arif mulyanto :</p>\r\n<p>1. Penelitian trkait di ganti dng pnelitian yg ad di dinas kesehatan provinsi.</p>\r\n<p>2. Penelitian trkait klau bisa ambil dari skripsi di ung ( sya ambil skripsi yg mhswa bimbinganya bpk)</p>\r\n<p>3. Redaksi kalimat ruang lingkup penelitian di tambahkan menjadi MEA01, MEA02, dan MEA03. sbelumnya hanya MEA scra kseluruhan.</p>\r\n<p>4. Rancangan penelitian sya pnya metode penelitian deskriptif. Sranya di ganti mnjadi penlitian evaluasi yang hasilnya nanti brupa rekomendasi perbaikan</p>\r\n<p>5. Teknik pengumpulan data klau bisa di tambhkan studi pustaka</p>\r\n<p>6. Daftar pustaka di perbaiki ada yg pkai tanda ( ) dan ad yg tidak.</p>\r\n<p>7. Kalau memungkinkan di cari sumber revensi dari buku yg trbaru.</p>\r\n<p>Dari ibu siti.</p>\r\n<p>1. Pnjlesan lebih rinci mngenai sistm komunikasi data</p>\r\n<p>2. Prmasalhn dlam penelitian di tambhkn</p>\r\n<p>3. Ambil pnelitian trkait dri skripsi di jurusan.</p>\r\n<p>Dari Pak aan :</p>\r\n<p>1. Prmsalhan ltr blkang di di tambhkn</p>\r\n<p>2. Metode penelitan juga diganti brdasrkan sran dri pk arif.</p>', NULL, NULL, '1', 5),
(9, '2020-07-11 03:01:05', '2020-07-11 03:01:05', '<p>Lampirkan Bab 1-3</p>', NULL, '1', NULL, 4),
(11, '2020-07-11 03:53:56', '2020-07-11 03:53:56', '<p>berikut revisi proposal saya pak</p>', '20200711115356.pdf', NULL, '1', 7),
(12, '2020-07-11 03:59:43', '2020-07-11 03:59:43', '<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">Assalamualaikum pak,</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">ini laporan KP kami, maaf baru bisa kirim pak soalnya untuk keseluruhan laporan dan aplikasi baru di acc pembimbing 1, dan kami juga mengira dari kemarin untuk asistensi sama bapak harus tatap muka.</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">terimakasih pak.</p>', '20200711115943.pdf', NULL, '1', 8),
(13, '2020-07-11 06:39:13', '2020-07-11 06:39:13', '<p>1. Ikuti langkah-langkah penelitian pada Bab 3&nbsp; :</p>\r\n<ul>\r\n<li>Studi lapangan-penentuan responden (hasilnya apa) ini tidak terlihat pada Bab 4.&nbsp;</li>\r\n<li>Pengumpulan data di Bab 3 ada dua langkah (Observasi hasilnya apa)</li>\r\n</ul>\r\n<p>2. Coba perhatikan cara menyusun kuisioner pada COBIT 5 sebagai berikut :&nbsp;<a href=\"https://www.youtube.com/watch?v=crlmxqTNDxE\">https://www.youtube.com/watch?v=crlmxqTNDxE</a></p>\r\n<p>2. Uji validitas instrumen pada saat disusun kuisioner (ada), hasil uji validitas ketika kuisioner diisi apakah isian valid/tidak ? (Tidak ada di laporan)</p>\r\n<p>4. Coba perhatikan jurnal ini :&nbsp;<a href=\"http://eprints.dinus.ac.id/19426/2/jurnal_18382.pdf\">http://eprints.dinus.ac.id/19426/2/jurnal_18382.pdf</a></p>', NULL, '1', NULL, 4),
(14, '2020-07-11 06:48:26', '2020-07-11 06:48:26', '<p>Coba lihat file ini :&nbsp;<a href=\"https://www.academia.edu/8546156/COBIT_Self-Assessment_Guide_Using_COBIT_5?auto=download\">https://www.academia.edu/8546156/COBIT_Self-Assessment_Guide_Using_COBIT_5?auto=download</a></p>\r\n<p>Bagaimana cara mengukur COBIT 5 sesungguhnya.</p>', NULL, '1', NULL, 4),
(15, '2020-07-11 08:45:12', '2020-07-11 08:45:12', '<p>Ikuti panduan KP khususnya di Bab 3 harus memuat :</p>\r\n<p>1. Analisis Proses bisnis</p>\r\n<p>2. Rekayasa Proses bisnis</p>', '20200711164512.pdf', '1', NULL, 8),
(16, '2020-07-11 11:52:54', '2020-07-11 11:52:54', '<p>Mohon maaf pak, untuk penyusunan laporan sebelumnya kami sudah menggunakan seperti yang bapak kasih, tapi dari teman teman yang lain&nbsp; katanya untuk kita sistematika penyusunannya pakai yang ini pak</p>\r\n<p>&nbsp;</p>\r\n<p>(*format daftar isi terlampir)</p>\r\n<p>&nbsp;</p>\r\n<p>jadinya kami menggunakan ini pak.</p>\r\n<p>&nbsp;</p>\r\n<p>mohon bimbinganya pak, terima kasih.</p>', '20200711195254.pdf', NULL, '1', 8),
(17, '2020-07-12 02:33:36', '2020-07-12 02:33:36', '<p>Ikuti panduan yang sudah saya berikan</p>', NULL, '1', NULL, 8),
(18, '2020-07-12 05:40:15', '2020-07-12 05:40:15', '<p>Assalamualakum pak,</p>\r\n<p>ini laporan kami pak, sudah diubah berdasarkan paduan yang pak berikan yang dimana memuat analisis proses bisnis dan rekayasa proses bisnis.</p>\r\n<p>mohon bimbinganya pak, Terima Kasih.</p>', '20200712134015.pdf', NULL, '1', 8),
(19, '2020-07-12 06:00:43', '2020-07-12 06:00:43', '<p>Revisi :</p>\r\n<p>1. Proses bisnis adalah aktivitas-aktivitas yang berjalan di kantor (secara manual) berbeda dengan flowchart sistem yang fokus pada sistem. Proses bisnis dapat digambarkan dalam bentuk CFF atau menggunakan notasi BPMN (bisa dibaca di :&nbsp;<a href=\"http://ccg.co.id/blog/2017/04/28/pemodelan-proses-bisnis-dengan-bpmn/\">http://ccg.co.id/blog/2017/04/28/pemodelan-proses-bisnis-dengan-bpmn/)</a></p>\r\n<p>Contoh proses bisnis pada perusahaan : Membeli barang (suku cadang), merawat suku cadang, membuat laporan keuangan, dan lain sebagainya.</p>\r\n<p>&nbsp;</p>\r\n<p>Proses bisnis utama : permohonan izin uji material (bukan yang telah ditulis di laporan).&nbsp;</p>\r\n<p>Proses bisnis pendukung : penyiapan personil penguji</p>\r\n<p>&nbsp;</p>\r\n<p>2. Adapun rekayasa proses bisnis didapatkan setelah menganalisis proses bisnis sebelumnya (ini digambarkan lagi dengan BPMN mana proses yang telah direkayasa sehingga lebih baik dari proses sebelumnya). Bisa dilihat contoh kasus rekayasa proses bisnis dalam jurnal ini :&nbsp;<a href=\"https://ejournal.undip.ac.id/index.php/jgti/article/view/16390/11989\">https://ejournal.undip.ac.id/index.php/jgti/article/view/16390/11989</a></p>\r\n<p>&nbsp;</p>\r\n<p>Silahkan disesuaikan dengan laporannya</p>', NULL, '1', NULL, 8),
(20, '2020-07-12 06:04:55', '2020-07-12 06:04:55', '<p>Bisa baca2 disini :&nbsp;</p>\r\n<p><a href=\"https://www.academia.edu/36455351/Rekayasa_Ulang_Proses_Bisnis\">https://www.academia.edu/36455351/Rekayasa_Ulang_Proses_Bisnis</a></p>\r\n<p><a href=\"https://www.researchgate.net/publication/319097552_Business_Process_Re-engineering_Rekayasa_Proses_Bisnis\">https://www.researchgate.net/publication/319097552_Business_Process_Re-engineering_Rekayasa_Proses_Bisnis</a></p>\r\n<p>https://ejournals.umn.ac.id/index.php/SI/article/view/216/188</p>\r\n<p>https://journal.uii.ac.id/Snati/article/download/3116/2848</p>\r\n<p>&nbsp;</p>', NULL, '1', NULL, 8),
(21, '2020-07-13 02:54:17', '2020-07-13 02:54:17', '<p>Assalamualakum pak,</p>\r\n<p>ini revisi dari Laporan KP kami, untuk penggambaran proses bisnis berjalan dan usulan menggunakan CFF, sesuai dengan yang telah kami pelajari di MK Analisis Proses Bisnis.</p>\r\n<p>Mohon Bimbingannya pak, Terima Kasih.</p>\r\n<p>&nbsp;</p>', '20200713105417.pdf', NULL, '1', 8),
(22, '2020-07-13 08:09:23', '2020-07-13 08:09:23', '<ol>\r\n<li>Pada rekayasa proses bisnis mengapa peran petugas pelayanan ditiadakan ? Apa alasannya ? jelaskan</li>\r\n<li>Pada proses bisnis permohonan uji material, redaksi menindaklanjuti pada Kepala uptd sebaiknya diganti dengan kondisi persetujuan, jika tidak disetujui maka aktivitas berikutnya biasanya pada organisasi tidak langsung berhenti namun memperbaiki berkas atau melengkapi kekurangan (kecuali dua hal tersebut tidak memang tidak dipenuhi oleh pemohon)</li>\r\n<li>Pada proses bisnis penyiapan personil, biasanya ada kondisi apakah personil pengujian tersedia(siap)/tidak tersedia (tidak siap) baru kemudian ke aktivitas melaksanakan tugas atau pending (karena personil tidak siap)</li>\r\n</ol>', NULL, '1', NULL, 8),
(23, '2020-07-13 10:21:14', '2020-07-13 10:21:14', '<ol>\r\n<ol>\r\n<li>pada rekayasa proses bisnis peran petugas pelayanan masih ada, hanya saja saya dalam penggambarannya saya menggunakan kata admin, yang di mana admin ini sendiri yang nantinya akan dipakai oleh petugas pelayanan. tapi sebenarnya setelah saya pikir baik baik, saya salah dalam penamaan admin itu pak, jadinya admin akan digantikan pelayanan petugas pada rekayasa proses bisnis, jadi nanti akan saya koreksi pak</li>\r\n<li>untuk redaksi menindak lanjuti pada kepala uptd, sebelumnya pak sekedar informasi saja bahwa aplikasi yang saya buat ini permintaan dari pihak kantor sendiri dan proses penindak lanjuti yang diminta dari pihak kantor memang seperti itu pak jadinya pada sistem berjalan yang ada di lembaran permohonan pengujian dibagian kepala UPTD memang hanya seperti itu pak jadinya disitu sudah tersedia pilihan tindakan kepala UPTD, tugas Kepala UPTD hanya memilih tindakan yang sudah tersedia memang di lembaran permohonan tersebut. jadinya pada aplikasi yang sudah saya buat seperti permintaan dari pihak kantor, ketika petugas pelayanan selesai menginput permohonan pengujian, maka data permohonan akan tersimpan ke database dan akan diteruskan ke Kepala UPTD terus, untuk Kepala UPTD akan membaca permohonan tersebut lalu dia dapat memilih tindakan apa yang harus dilakukan yang ketika salah satu tindakan sudah dipilih permohonan pengujian di update dengan tambahan sudah ada tindakan di database yang nantinya tindakan itu akan dilaksanakan oleh Kasie Uji Material</li>\r\n<li>sama halnya dengan poin nomor 2 jadi aplikasi yang diminta dari pihak kantor untuk kasie uji material hanya seperti itu pak, kasie uji material tinggal memilih nama penyelia/supervisor yang akan melaksanakan tugas tersebut, jadi sebenarnya output akhir dari aplikasi yang diminta dari pihak kantor hanya berupa data yang berisikan informasi pelayan pengujian + tindakan apa yang dipilh dari kepala uptd + nama personil penguji yang dipilih kasie uji material</li>\r\n</ol>\r\n</ol>\r\n<p>mohon koreksinya pak jika ada kesalahan, terimakasih.</p>', NULL, NULL, '1', 8),
