(36, '2020-07-16 01:36:17', '2020-07-16 01:36:17', '<p>1. simbol proses di diagram konteks dan hierarchi chart masih ada yang tidak bulat.</p>\r\n<p>2. perbaiki simbol simpanan data di DAD. harusnya dua garis di atas dan abawah tanpa ada garis di kiri dan kanan</p>\r\n<p>3. perbaiki nama proses yang belum menggunkan kata kerja. contoh proses 1.2, harusnya input jenis bibit. (sek samua, termasuk di hierarchi chart.</p>\r\n<p>4. perbaiki DAD level 1 proses 2. harusnya terdiri dari 2 proses. (sesuaikan dengan hierachi chart, tapi harus kata kerja). lengkapi nama arus datanya.</p>\r\n<p>5. perbaiki nama proses di DAD level 1 proses 3. lengkapi dengan arus data.</p>\r\n<p>6. perbaiki kesimpulan. berisi hasil analisis dan hasil rekayasa proses bisnis. misal: verdasarkan hasil analisis menggunakan metode peningkatan proses bisnis, diperoleh proses bisnis yang belum optimal yaitu bla bla bla dst. jelaskan juga akar permasalahannya. jelaskan rekaya proses bisnis yang dilakukan, termasuk usulan perancangan sistem untuk mendukung rekayasa proses bisnis.</p>\r\n<p>7. perbaiki initisari kalimat terakhir. isinya hasil analisis dan rekayasa proses bisnis. ringkasan dari kesimpulan. intisari posisinya di depan.&nbsp;</p>\r\n<p>&nbsp;</p>', NULL, '1', NULL, 12),
