(70, '2020-07-27 05:48:09', '2020-07-27 05:48:09', '<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">Assalamualaikum wr wb. Maaf menggagu pak</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">Saya mewakili kelompok saya mau bimbingan Laporan KP untuk kelompok kami.&nbsp;</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">Bab 1 : Berisi gambaran - gambaran tentang perusahaan seperti (sejarah, struktur organisasi, fisi misi dll).</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">Bab 2 : Proses bisnis/alur bisnis yang ada di perusahaan.</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">Bab 3 : Sistem usulan yang akan di buat.</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">Di bab 2 itu terdapat beberapa proses bisnis pak dan kelompok kami fokus di proses bisnis untuk pendaftaran dan kelengkapan berkas2 data user yang akan membeli perumahan.</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">Kami juga menyertakan file laporannya pak</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">Mohon saran bimbingan dan masukan dari bapak.</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">Terimakasih.</p>', '20200727134809.pdf', NULL, '1', 27),
(71, '2020-07-27 05:52:42', '2020-07-27 05:52:42', '<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">Assalamualaikum wr wb</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">Maaf pak sudah mengganggu waktunya. Pak saya mau bimbingan mengenai laporan Kerja Pratek</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">BAB 1 Berisikan Gambaran Perusahaan</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">BAB 2&nbsp; Berisikan Alur Sistem (Proses Bisnis)&nbsp; yang berjalan di perusahaan</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">BAB 3 Berisikan Sistem Usulan yang akan kami buat untuk perusahaan.</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">Jadi Pak, kami fokus di proses bisnis Kelengkapan Berkas Pembelian Perumahan yang di lakukan oleh PT Sinar Cahaya Langit.</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">kami juga menyertakan File Laporannya Pak.</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">Mohon Saran dan Masukan dari Bapak</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px;\">Terimasih Pak</p>\r\n<ul class=\"nav nav-pills nav-justified\" style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 0px; display: flex; flex-wrap: wrap; padding-left: 0px; list-style: none; color: #212529; font-size: 16px;\">\r\n<li class=\"nav-item mx-0 px-0\" style=\"box-sizing: border-box; flex-basis: 0px; flex-grow: 1; text-align: center; margin-right: 0px !important; margin-left: 0px !important; padding-right: 0px !important; padding-left: 0px !important;\">&nbsp;</li>\r\n</ul>\r\n<p class=\"my-0 py-0\" style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px !important; margin-bottom: 0px !important; padding-top: 0px !important; padding-bottom: 0px !important; color: #212529; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial;\">&nbsp;</p>\r\n<p style=\"box-sizing: border-box; font-family: Jost, raleway, lato, sans-serif; margin-top: 0px; margin-bottom: 1rem; color: #212529; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial;\">&nbsp;</p>', NULL, NULL, '1', 28),
